1. Key psychological mechanisms: When acting as a proposer, participants consider their own contribution relative to their opponent’s contribution. This relates to fairness—the idea that the share offered to the opponent should reflect the opponent’s input. A simple fairness heuristic is to compare the tokens found by the opponent to the total tokens found.
2. Mechanism interaction: The perceived fairness (or inequity) can be summarized as the opponent’s token proportion = token_opp/(token_self+token_opp). A baseline fairness predisposition then modulates this signal. Participants’ proposals to the opponent are assumed to follow a soft “squashing” function (i.e., logistic function) to map this internal fairness evaluation to a percentage on a bounded scale (0 to 100%).
3. Mathematical form: We use a logistic model. Let F = token_opp/(token_self+token_opp) be the fairness signal from the contributions. Then, we compute 
  predicted_proposed_perc = 100/(1+exp(–(beta0 + beta1*F))).
4. Needed Parameters:
 – beta0: A learnable intercept reflecting the baseline propensity to propose a share.
 – beta1: A learnable sensitivity to the fairness signal.
These two parameters are chosen for parsimony and to reduce covariance issues.
5. Mapping: The observable data variables token_opp and token_self (from the dataset) are directly used to form the fairness measure F, and the model then predicts the proposed_perc (the target variable) using the logistic mapping scaled to 100.

