def simulate_model(trial_data, beta0=0, beta1=0):
    model_predictions = []
    for trial in trial_data:
        token_opp = trial.get("token_opp", 0)
        token_self = trial.get("token_self", 0)

        if (token_self + token_opp) == 0:
            fairness_ratio = 0  # Avoid division by zero
        else:
            fairness_ratio = token_opp / (token_self + token_opp)

        exponent = -(beta0 + beta1 * fairness_ratio)
        proposed_perc_hat = 100 / (1 + math.exp(exponent))
        model_predictions.append(proposed_perc_hat)
    return model_predictions
